import React, { Component } from 'react';
import './BootomBanner.css';
class BootomBanner extends Component {
    render() {
        return (
            <div className = "bootom-banner">
                <a href="#">
                    <img src = "https://d1k2oi80tv211b.cloudfront.net/hvn/images/hlpromo.jpg" alt = "Image Bootom Banner"/>
                </a>
            </div>
        );
    }
}

export default BootomBanner;
